pragma solidity ^0.8.0;








/// @title Defo Sapphire Node Minting Contract
/// @notice Contract for minting sapphire nodes

contract SapphireNode is ERC721Enumerable, Ownable {
    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private supply;

    bool public activeSale = false;
    uint64 public maxTotalSapphireNodes = 480; // total supply of sapphire nodes
    uint64 public maxNodesPerWallet = 15; // max number of sapphire nodes one can hold per wallet
    uint256 public sapphireNodePrice = 50;
    address private constant FEE_COLLECTOR =
    0xAEf6Bd49e374C067672bABC554A7AEe36fb71267;
    uint256 constant DECIMAL_MULTIPLIER = 10 ** 18;
    string private baseURI;
    bool transferLock = true;
    address[] whitelist;
    IERC20 DAIToken;

    constructor(address DAI_address) ERC721("Defo Sapphire Node", "DSN") {
        DAIToken = IERC20(DAI_address);
        whitelist.push(address(0));
        whitelist.push(address(0x000000000000000000000000000000000000dEaD));
        whitelist.push(address(FEE_COLLECTOR));
        for (uint256 index = 0; index < 41; index++) {
            supply.increment();
            _safeMint(msg.sender, supply.current());
        }
    }

    /// @notice allows users to mint sapphire nodes
    function mintNode() public payable {
        require(activeSale = true, "Sale is not currently active");
        require(
            balanceOf(msg.sender) <= maxNodesPerWallet,
            "Cannot mint more than `maxNodePerWallet` nodes"
        );
        require(
            supply.current() <= maxTotalSapphireNodes,
            "No more sapphire nodes to mint"
        );
        require(
            DAIToken.balanceOf(msg.sender) >=
            sapphireNodePrice * DECIMAL_MULTIPLIER,
            "Insuffucient DAI balance"
        );

        DAIToken.transferFrom(
            msg.sender,
            FEE_COLLECTOR,
            sapphireNodePrice * DECIMAL_MULTIPLIER
        );
        supply.increment();
        _safeMint(msg.sender, supply.current());
    }

    function giveAwayMint() public onlyOwner {
        require(
            supply.current() <= maxTotalSapphireNodes,
            "No more sapphire nodes to mint"
        );
        supply.increment();
        _safeMint(msg.sender, supply.current());
    }

    /// @notice allows the owner to set the total amount of sapphire nodes
    function setMaxTotalSapphireNodes(uint64 _newNodeAmount)
    external
    onlyOwner
    {
        maxTotalSapphireNodes = _newNodeAmount;
    }

    /// @notice allows the owner to render the sale inactive/active, in other words pausing and resuming
    function setSaleState() external onlyOwner {
        activeSale = !activeSale;
    }

    ///@notice allows the owner to set the max amount of nodes one wallet can hold
    function setMaxPerWallet(uint64 _newAmount) external onlyOwner {
        maxNodesPerWallet = _newAmount;
    }

    /// @notice allows the owner to set the baseURI
    function setBaseURI(string memory _tokenBaseURI) external onlyOwner {
        baseURI = _tokenBaseURI;
    }

    /// @notice returns the baseURI
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    /*
    /// @notice allows owner to withdraw DAI tokens in this contract
    function withdrawTokens() public onlyOwner {
        DAIToken.transferFrom(
            address(this),
            msg.sender,
            DAIToken.balanceOf(address(this))
        );
    }
*/
    function totalSupply() public view override returns (uint256) {
        return (supply.current());
    }

    function setTransferLock() public onlyOwner {
        transferLock = !transferLock;
    }

    function addToWhitelist(address _whitelistedAddress) public onlyOwner {
        whitelist.push(_whitelistedAddress);
    }

    function getPrice() external view returns (uint256) {
        return sapphireNodePrice;
    }

    /// @dev lock transfer
    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override {
        if (transferLock) {
            bool transferblock = true;
            for (uint256 index = 0; index < whitelist.length; index++) {
                if (from == whitelist[index] || to == whitelist[index]) {
                    transferblock = false;
                    continue;
                }
            }
            require(!transferblock, "Transfer is forbidden");
        }
        super._transfer(from, to, tokenId);
    }
}
